Sure, here's an example Terraform code that deploys a Docker application on AWS ECS (Elastic Container Service) with an Application Load Balancer (ALB):

```hcl
# Configure AWS provider
provider "aws" {
  region = "us-west-2" # Replace with your desired AWS region
}

# Create VPC, subnets, and other networking resources
# (Omitted for brevity)

# Create ECS cluster
resource "aws_ecs_cluster" "my_cluster" {
  name = "my-cluster"
}

# Create ECS task definition
resource "aws_ecs_task_definition" "my_task_definition" {
  family                   = "my-task-definition"
  cpu                      = "256"
  memory                   = "512"
  network_mode             = "awsvpc"
  requires_compatibilities = ["FARGATE"]
  container_definitions    = <<DEFINITION
[
  {
    "name": "my-container",
    "image": "your-docker-image:latest",
    "portMappings": [
      {
        "containerPort": 80,
        "hostPort": 80
      }
    ]
  }
]
DEFINITION
}

# Create ECS service
resource "aws_ecs_service" "my_service" {
  name            = "my-service"
  cluster         = aws_ecs_cluster.my_cluster.id
  task_definition = aws_ecs_task_definition.my_task_definition.arn
  desired_count   = 2 # Number of task instances
  launch_type     = "FARGATE"

  network_configuration {
    subnets          = ["subnet-1234abcd", "subnet-5678efgh"] # Replace with your desired subnets
    assign_public_ip = true # Assign public IP to the Fargate tasks
    security_groups  = ["sg-0987ijkl"] # Replace with your desired security group
  }

  load_balancer {
    target_group_arn = aws_lb_target_group.my_target_group.arn
    container_name   = "my-container"
    container_port   = 80
  }
}

# Create Application Load Balancer
resource "aws_lb" "my_lb" {
  name               = "my-lb"
  load_balancer_type = "application"
  subnets            = ["subnet-1234abcd", "subnet-5678efgh"] # Replace with your desired subnets
  security_groups    = ["sg-0987ijkl"] # Replace with your desired security group
}

# Create ALB target group
resource "aws_lb_target_group" "my_target_group" {
  name        = "my-target-group"
  port        = 80
  protocol    = "HTTP"
  vpc_id      = "vpc-0123456789abcdef" # Replace with your VPC ID
  target_type = "ip"
}

# Create ALB listener
resource "aws_lb_listener" "my_listener" {
  load_balancer_arn = aws_lb.my_lb.arn
  port              = "80"
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_lb_target_group.my_target_group.arn
  }
}
```

Here's what this Terraform code does:

1. Configures the AWS provider with your desired region.
2. Creates an ECS cluster named `my-cluster`.
3. Creates an ECS task definition named `my-task-definition` with the specified Docker container image, CPU, and memory resources. The container is configured to listen on port 80.
4. Creates an ECS service named `my-service` with two task instances running on AWS Fargate. The service is associated with the previously created task definition and the Application Load Balancer target group.
5. Creates an Application Load Balancer (ALB) named `my-lb` and attaches it to the desired subnets and security groups.
6. Creates an ALB target group named `my-target-group` for the ECS service to register its tasks.
7. Creates an ALB listener on port 80
